      "en": "Convert search term to kana",
      "de": "Suchbegriff in Kana umwandeln",
      "ru": "Преобразование поискового термина в кану",
      "ja": "検索語をかなに変換する",
      "zh": "将搜索词转换为假名",
      "it": "Convertire i termini di ricerca in kana",
      "fr": "Convertir les termes de recherche en kana",
